import './App.css';
import SearchBar from './Searchbar.js'
import Auth from './Auth.js'
import { useState } from 'react';


function App() {

  const [data,setData] = useState({})

  const updateData = (searchParams) => {
    setData(searchParams);
  }
  return (
    <div className = 'container'>
      <div className='row'>
        <h1>Welcome to Easy Tracking!</h1>
      </div>
      <div className='row'>
      <p> This app was created in order to make it easier for people to track their daily calorie intake. here you can browse from a database of many types of foods and add it to your personal meals 
        You can also calculate your pesonal BMR which will help you get to your daily calorie goal. 
        </p>
      </div>

      <SearchBar callback={updateData} />
      <p>Food: {"Name" in data ? data["Name"] : "No data to display" }</p>
      {data["Name"] && <button>Add to My meals</button>}
    </div>
  );
}



export default App;
